export const travelInfoBeforeDeparture = [
    {
        id: 1,
        title: "캐나다 밴쿠버 어학연수 준비",
        likes: 42,
        author: "여행자123",
        date: "2023-07-15",
        content: "밴쿠버 어학연수를 위해서는 전자 여행 허가(eTA)가 필요합니다. 캐나다 달러(CAD)를 준비해야 하며, 5월에서 9월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어와 프랑스어가 주로 사용됩니다. 대체로 안전하지만 도심 외곽은 주의가 필요하며, 우산과 따뜻한 옷을 챙기는 것이 좋습니다.",
        country: "캐나다",
        comments: [
            { id: 1, author: "밴쿠버러버", content: "저도 밴쿠버 정말 좋아해요! 다음엔 그랜빌 아일랜드도 가보세요." },
            { id: 2, author: "여행준비중", content: "유용한 정보 감사합니다. 숙소는 어느 지역에 잡으셨나요?" }
        ]
    },
    {
        id: 2,
        title: "호주 시드니 여행 준비",
        likes: 38,
        author: "문화탐험가",
        date: "2023-07-20",
        content: "시드니 여행을 위해서는 전자 여행 허가(eVisitor)가 필요합니다. 호주 달러(AUD)를 준비해야 하며, 9월에서 11월, 3월에서 5월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어가 주로 사용됩니다. 대체로 안전하지만 일부 지역은 밤에 주의가 필요하며, 선크림과 모자를 챙기는 것이 좋습니다.",
        country: "호주",
        comments: [
            { id: 1, author: "호주유학생", content: "오페라 하우스 야경도 정말 멋져요!" },
            { id: 2, author: "건축학도", content: "건축 디자인이 정말 독특하죠. 우트존 설계의 걸작이에요." }
        ]
    },
    {
        id: 3,
        title: "독일 베를린 여행 준비",
        likes: 55,
        author: "역사buff",
        date: "2023-08-05",
        content: "베를린 여행을 위해서는 쉥겐 비자가 필요합니다 (90일 이내 무비자 가능). 유로(EUR)를 준비해야 하며, 5월에서 9월 사이가 가장 좋은 여행 시기입니다. 현지에서는 독일어가 주로 사용됩니다. 대체로 안전하지만 관광지에서는 소매치기를 주의해야 하며, 편한 신발을 챙기는 것이 좋습니다.",
        country: "독일",
        comments: [
            { id: 1, author: "독일어학습자", content: "베를린 여행 계획 중인데 꼭 가봐야겠어요!" },
            { id: 2, author: "평화주의자", content: "과거의 아픔을 기억하고 평화의 소중함을 되새기는 좋은 기회였겠네요." }
        ]
    },
    {
        id: 4,
        title: "영국 런던 여행 준비",
        likes: 60,
        author: "야경사진가",
        date: "2023-08-10",
        content: "런던 여행을 위해서는 전자 여행 허가(ETA)가 필요합니다 (2024년부터). 영국 파운드(GBP)를 준비해야 하며, 3월에서 5월, 9월에서 11월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어가 주로 사용됩니다. 대체로 안전하지만 도심지에서는 소매치기를 주의해야 하며, 우산을 챙기는 것이 좋습니다.",
        country: "영국",
        comments: [
            { id: 1, author: "영국마니아", content: "와... 사진이 정말 멋집니다! 카메라 설정 공유해주실 수 있나요?" },
            { id: 2, author: "여행계획중", content: "혹시 야경 투어 추천해주실만한 곳 있나요?" }
        ]
    },
    {
        id: 5,
        title: "독일 뮌헨 여행 준비",
        likes: 70,
        author: "맥주애호가",
        date: "2023-09-15",
        content: "뮌헨 여행을 위해서는 쉥겐 비자가 필요합니다 (90일 이내 무비자 가능). 유로(EUR)를 준비해야 하며, 9월에서 10월 사이가 가장 좋은 여행 시기입니다. 현지에서는 독일어가 주로 사용됩니다. 대체로 안전하지만 축제 기간에는 소매치기를 주의해야 하며, 전통 의상을 준비하면 더욱 즐거운 여행이 될 수 있습니다.",
        country: "독일",
        comments: [
            { id: 1, author: "독일유학생", content: "옥토버페스트 정말 재밌죠! 다음엔 저도 꼭 가보고 싶어요." },
            { id: 2, author: "맥덕", content: "어떤 맥주가 제일 맛있었나요? 추천해주세요!" }
        ]
    },
    {
        id: 6,
        title: "뉴질랜드 퀸스타운 여행 준비",
        likes: 80,
        author: "모험가",
        date: "2023-10-01",
        content: "퀸스타운 여행을 위해서는 전자 여행 허가(NZeTA)가 필요합니다. 뉴질랜드 달러(NZD)를 준비해야 하며, 12월에서 2월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어가 주로 사용됩니다. 대체로 안전하지만 액티비티 시에는 안전 장비를 철저히 준비해야 하며, 모험을 좋아하는 여행자에게 추천합니다.",
        country: "뉴질랜드",
        comments: [
            { id: 1, author: "용기부자", content: "와... 저는 못할 것 같아요. 정말 대단하십니다!" },
            { id: 2, author: "여행좋아", content: "퀸스타운에서 다른 추천할 만한 액티비티 있나요?" }
        ]
    },
    {
        id: 7,
        title: "네덜란드 암스테르담 여행 준비",
        likes: 65,
        author: "자전거매니아",
        date: "2023-10-10",
        content: "암스테르담 여행을 위해서는 쉥겐 비자가 필요합니다 (90일 이내 무비자 가능). 유로(EUR)를 준비해야 하며, 4월에서 5월 사이가 가장 좋은 여행 시기입니다. 현지에서는 네덜란드어가 주로 사용됩니다. 대체로 안전하지만 자전거 도로에서는 안전에 주의해야 하며, 자전거 여행을 즐기는 여행자에게 추천합니다.",
        country: "네덜란드",
        comments: [
            { id: 1, author: "네덜란드팬", content: "암스테르담은 정말 자전거 천국이죠. 렌트 비용은 어느 정도였나요?" },
            { id: 2, author: "여행초보", content: "자전거 여행 팁 좀 알려주세요. 처음이라 걱정되네요." }
        ]
    },
    {
        id: 8,
        title: "캐나다 재스퍼 국립공원 여행 준비",
        likes: 58,
        author: "산악인",
        date: "2023-10-20",
        content: "재스퍼 국립공원 여행을 위해서는 전자 여행 허가(eTA)가 필요합니다. 캐나다 달러(CAD)를 준비해야 하며, 6월에서 9월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어와 프랑스어가 주로 사용됩니다. 대체로 안전하지만 자연 속에서의 활동 시에는 안전에 주의해야 하며, 하이킹을 즐기는 여행자에게 추천합니다.",
        country: "캐나다",
        comments: [
            { id: 1, author: "자연러버", content: "재스퍼 꼭 가보고 싶었어요! 어느 계절에 가셨나요?" },
            { id: 2, author: "등산초보", content: "하이킹 코스 난이도는 어떤가요? 초보자도 도전해볼 만한가요?" }
        ]
    },
    {
        id: 9,
        title: "호주 그레이트 오션 로드 여행 준비",
        likes: 75,
        author: "로드트리퍼",
        date: "2023-11-05",
        content: "그레이트 오션 로드 여행을 위해서는 전자 여행 허가(eVisitor)가 필요합니다. 호주 달러(AUD)를 준비해야 하며, 9월에서 11월, 3월에서 5월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어가 주로 사용됩니다. 대체로 안전하지만 도로 주행 시에는 안전 운전에 주의해야 하며, 드라이브를 즐기는 여행자에게 추천합니다.",
        country: "호주",
        comments: [
            { id: 1, author: "드라이브매니아", content: "그레이트 오션 로드는 정말 꿈의 코스죠. 렌트카 이용하셨나요?" },
            { id: 2, author: "사진작가", content: "12사도 바위 일출 사진이 정말 멋져요. 촬영 팁 좀 알려주세요." }
        ]
    },
    {
        id: 10,
        title: "영국 코츠월드 여행 준비",
        likes: 62,
        author: "시골여행자",
        date: "2023-11-15",
        content: "코츠월드 여행을 위해서는 전자 여행 허가(ETA)가 필요합니다 (2024년부터). 영국 파운드(GBP)를 준비해야 하며, 4월에서 10월 사이가 가장 좋은 여행 시기입니다. 현지에서는 영어가 주로 사용됩니다. 대체로 안전하지만 시골 마을에서는 긴급 상황 시 도움을 받을 수 있는 방법을 알아두어야 하며, 시골의 정취를 즐기는 여행자에게 추천합니다.",
        country: "영국",
        comments: [
            { id: 1, author: "영국투어러", content: "코츠월드는 정말 로맨틱하죠. 숙소 추천해주실 만한 곳 있나요?" },
            { id: 2, author: "시골마니아", content: "현지 특산품이나 기념품 중 추천할 만한 게 있을까요?" }
        ]
    }
];
